import React, { useState, useEffect } from 'react';

const Booking = () => {
  const [bookings, setBookings] = useState([]);
  const [formData, setFormData] = useState({
    date: '',
    time: '',
    guests: 1,
  });
  const [editingBooking, setEditingBooking] = useState(null);
  const [userName, setUserName] = useState(''); // Store userName in state
  const [userEmail, setUserEmail] = useState(''); // Store userEmail in state
  const [message, setMessage] = useState('');
  const isLoggedIn = !!localStorage.getItem('token'); // Check login status

  // Fetch bookings and user details
  useEffect(() => {
    const fetchBookings = async () => {
      try {
        const token = localStorage.getItem('token');
        if (!token) return; // Don't fetch if not logged in

        // Fetch bookings
        const response = await fetch('/api/bookings', {
          headers: {
            Authorization: `Bearer ${token}`,
          },
        });

        if (!response.ok) {
          throw new Error('Failed to fetch bookings');
        }

        const data = await response.json();
        setBookings(data);

        // Fetch user info (name and email)
        const userResponse = await fetch('/api/user', {
          headers: {
            Authorization: `Bearer ${token}`,
          },
        });

        if (!userResponse.ok) {
          throw new Error('Failed to fetch user info');
        }

        const userData = await userResponse.json();
        setUserName(userData.name); // Update state with userName
        setUserEmail(userData.email); // Update state with userEmail

        // Optionally store in localStorage (if you need persistence)
        localStorage.setItem('userName', userData.name);
        localStorage.setItem('userEmail', userData.email);
      } catch (error) {
        console.error('Error fetching bookings or user info:', error);
        setMessage('Error fetching bookings. Please try again later.');
      }
    };

    fetchBookings();
  }, []); // Run once on component mount

  const handleBooking = async (data) => {
    try {
      const token = localStorage.getItem('token');
      if (!token) throw new Error('You must log in to make a booking.');

      const response = await fetch('/api/bookings', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
          Authorization: `Bearer ${token}`,
        },
        body: JSON.stringify(data),
      });

      if (!response.ok) {
        const errorData = await response.json();
        const errorMessage = errorData.error || 'Failed to create booking.';
        throw new Error(errorMessage);
      }

      // Fetch updated bookings after successful creation
      const updatedBookings = await (
        await fetch('/api/bookings', {
          headers: {
            Authorization: `Bearer ${token}`,
          },
        })
      ).json();
      setBookings(updatedBookings);

      return { success: true, message: 'Booking created successfully!' };
    } catch (error) {
      console.error('Booking error:', error);
      return { success: false, message: error.message };
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setMessage('');

    const result = editingBooking
      ? await handleUpdateBooking({
          date: formData.date,
          time: formData.time,
          party_size: formData.guests,
        })
      : await handleBooking({
          date: formData.date,
          time: formData.time,
          party_size: formData.guests,
        });

    setMessage(result.message);
  };

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value,
    });
  };

  return (
    <div className="booking-page">
      <section className="hero-section d-flex justify-content-center align-items-center">
        <div className="container">
          <h1 className="display-4 text-white">Book Your Table</h1>
          <p className="lead text-white">Reserve your spot at Frankie's Restaurant</p>
          {isLoggedIn ? (
            <p className="text-success">
              Logged in as: {userName ? `${userName} (${userEmail})` : userEmail || 'User'}
            </p>
          ) : (
            <p className="text-warning">
              You are not logged in. Please log in to make reservations.
            </p>
          )}
        </div>
      </section>

      {/* Booking Form */}
      <div className="booking-form-section py-5">
        <div className="container">
          <h2 className="text-center mb-4">{editingBooking ? 'Edit Reservation' : 'Reservation Form'}</h2>
          <form onSubmit={handleSubmit}>
            <div className="mb-3">
              <label htmlFor="date" className="form-label">Reservation Date</label>
              <input
                type="date"
                className="form-control"
                id="date"
                name="date"
                value={formData.date}
                onChange={handleChange}
                required
              />
            </div>
            <div className="mb-3">
              <label htmlFor="time" className="form-label">Reservation Time</label>
              <input
                type="time"
                className="form-control"
                id="time"
                name="time"
                value={formData.time}
                onChange={handleChange}
                required
              />
            </div>
            <div className="mb-3">
              <label htmlFor="guests" className="form-label">Number of Guests</label>
              <input
                type="number"
                className="form-control"
                id="guests"
                name="guests"
                value={formData.guests}
                onChange={handleChange}
                min="1"
                required
              />
            </div>
            {message && <p className="text-center">{message}</p>}
            <div className="text-center">
              <button type="submit" className="btn btn-primary btn-lg">
                {editingBooking ? 'Update Reservation' : 'Confirm Reservation'}
              </button>
            </div>
          </form>
        </div>
      </div>
    </div>
  );
};

export default Booking;
